    true,nt"url": null,nt"notes": "This asset provides data on the acid-base
    status of lakes and streams. Key chemical indicators measured include: sulfate,
    nitrate, ammonium, chloride, Acid Neutralizing Capacity (ANC), pH, base cations,
    dissolved organic carbon (DOC), total aluminum. TIME and LTM are part of EPA's Environmental
    Monitoring and Assessment Program (EMAP). Long-term monitoring of the acid-base
    status (pH, ANC, SO4, NO3, NH4, DOC, base cations, Al) in lakes and streams.  Monitoring
    is conducted in acid sensitive regions of the Eastern U.S.",nt"license_title":
